import { Link } from 'react-router-dom'
const Logout = () => {

  const logout = () => {
    localStorage.removeItem('token')

    window.location.reload()
  }
  return (
    <div className='center'>
      <h1>Logout ?</h1>
      <button className='btn btn-info'>Logout</button>
    </div>
  )
}

export default Logout
